          .width($r('app.float.title_image_width'))
          .height($r('app.float.title_image_height'))
      }
      .height(CommonConstants.LAYOUT_FULL_SCREEN)
      .type(ButtonType.Normal)
      .aspectRatio(1)
      .backgroundColor(Color.Transparent)
