// 裁剪工具类
import { RegionItem } from '../viewmodel/RegionItem';
import { CommonConstants } from '../common/constant/CommonConstants';
/**
 * Crop 1:1.
 *
 * @param pixelMap.
 * @param width.
 * @param height.
 */
export async function square(pixelMap, width, height) {
    if (width < height) {
        pixelMap.crop({
            size: {
                width: width,
                height: width
            },
            x: 0,
            y: Math.round((height - width) / CommonConstants.AVERAGE_WEIGHT_WIDTH)
        });
    }
    else {
        pixelMap.crop({
            size: {
                width: height,
                height: height
            },
            x: Math.round((width - height) / CommonConstants.AVERAGE_WEIGHT_WIDTH),
            y: 0
        });
    }
}
/**
 * Common crop function.
 *
